What's a better #TBT than a Para Champs roundup? ⚡

@durandomara cleans up in the 100m (T12), 200m (T12) , & 400m (T12). 🥇🥇🥇🇨🇺

@ouhdadiyassine makes his PUMA debut in a big way with gold in the 5k (T13) and silver in the 1500m (T13). 🥇🥈🇪🇸

@salumkashafali strikes gold in the 100m (T13) lightning quick fashion. 🥇🇳🇴

@marlenevangansewinkel soars to silver in the Long Jump (T64). 🥈🇳🇱

@felix.streng strides to bronze in the 100m (T64). 🥉 🇩🇪

@timotheeadoplhe takes bronze in 100m (T11) & 400m (T11) for the host nation. 🥉🥉🇫🇷

